import * as React from 'react';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';


const MyFoodlogs = ({qty,Unit,food,Calories,date,isUser,id}) => {
  return (
    
 
    <Card sx={{ maxWidth: 345 }}>
      <CardActionArea>
        <CardMedia
          component="img"
          height="140"
          image="https://img.taste.com.au/1jyDeGmD/w720-h480-cfill-q80/taste/2018/12/broccoli-steaks-with-roasted-chickpeas-tomatoes-and-cashew-dressing-144935-2.jpg"
          alt="green iguana"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="div">
          {qty}{Unit}{food}
          </Typography>
          <Typography variant="body2" color="text.secondary">
           {Calories}
          </Typography>
        </CardContent>
      </CardActionArea>
    </Card>
    
  )
}

export default MyFoodlogs;
